import React from "react";

function Note() {
  return (
    <div className="note">
      <h1>Javascript and React.js</h1>
      <p>
        This was an amazing bootcamp taken up by Shaurya Sinha We covered
        everything from Scratch including Javascript React.js, HTML.
      </p>
    </div>
  );
}

export default Note;
